import AboveTheFold from "./Components/AboveTheFold";
import Navigation from "./Components/Navigation";
import RecentWork from "./Components/RecentWork";

function App() {
  return (
    <>
      <Navigation />
      <AboveTheFold />
      <RecentWork />
      <About />
    </>
  );
}

export default App;
